def fill_in_global(g0, g1,
                    rate: float,
                    min_gap: int=30) -> List[Segment]:
    filled: List[Segment] = []
    gap_len = g1 - g0 + 1
    if gap_len >= min_gap:
         #  DP 
        extras = find_large_valid_segments_in_range(g0, g1, rate, min_gap)
        # extras = find_segments_in_range(g0, g1)
